import { useHistory } from "react-router-dom";
import teamPic from "../assets/teampic.jpg"
import bearLogo from "../assets/bearLogo.png"
import NavBar from "./NavBar"
import SnarfsLogo from "../assets/snarfslogo.png"
const HomePage = ({ match  }) => {

    return ( 
        <>
        <NavBar></NavBar>


    <div className="w-full h-screen bg-red-400 z-10">
            <div className="w-full h-5/6 z-10 absolute"> 
            <p className=" text-8xl font-bold text-gray-600 text-center mt-48 pb-4">Washington University <br>
            </br> St. Louis</p><div className="w-3/4 mx-auto h-2 border-t-8 pt-4 pb-4 border-green-800"></div> <p className=" text-8xl text-white text-center">Ice Hockey</p></div> 
           <div className="w-full h-5/6 bg-blue-100 absolute bg-opacity-70"> </div> 
           <img className="w-full h-5/6 z-0"src={teamPic}></img>
        <div className="mx-auto flex">
            <img className="w-1/6 mx-auto" src={SnarfsLogo}></img><img className="w-1/6 mx-auto" src={SnarfsLogo}></img>
        </div>
    </div>

    </>
    )

};

export default HomePage;
